#include <fuzzer/FuzzedDataProvider.h>

#include <aconf.h>
#include <png.h>
#include <stddef.h>
#include <stdint.h>
#include <stdio.h>
#include <stdlib.h>
#include <string.h>
#include <vector>

#include "GString.h"
#include "GlobalParams.h"
#include "JBIG2Stream.h"
#include "Object.h"
#include "PDFDoc.h"
#include "Splash.h"
#include "SplashBitmap.h"
#include "SplashOutputDev.h"
#include "Stream.h"
#include "config.h"
#include "gfile.h"
#include "gmem.h"
#include "gmempp.h"
#include "parseargs.h"

extern "C" int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
  FuzzedDataProvider fdp(data, size);
  double hdpi = fdp.ConsumeFloatingPoint<double>();
  double vdpi = fdp.ConsumeFloatingPoint<double>();
  int rotate = fdp.ConsumeIntegral<int>();
  GBool useMediaBox = fdp.ConsumeBool();
  GBool crop = fdp.ConsumeBool();
  GBool printing = fdp.ConsumeBool();
  std::vector<char> payload = fdp.ConsumeRemainingBytes<char>();

  int firstPage = fdp.ConsumeIntegralInRange<int>(1, 100);
  int lastPage = fdp.ConsumeIntegralInRange<int>(firstPage, 100);

  Object xpdf_obj;
  xpdf_obj.initNull();
  BaseStream *stream = new MemStream(payload.data(), 0, payload.size(), &xpdf_obj);

  Object info, xfa;
  Object *acroForm;
  globalParams = new GlobalParams(NULL);
  globalParams->setErrQuiet(1);
  globalParams->setupBaseFonts(NULL);
  char yes[] = "yes";
  globalParams->setEnableFreeType(yes); // Yes, it's a string and not a bool.
  globalParams->setErrQuiet(1);

  PDFDoc *doc = NULL;
  try {
    PDFDoc doc(stream);
    if (doc.isOk() == gTrue) {
      doc.getNumPages();
      doc.getOutline();
      doc.getStructTreeRoot();
      doc.getXRef();
      doc.okToPrint(gTrue);
      doc.okToCopy(gTrue);
      doc.okToChange(gTrue);
      doc.okToAddNotes(gTrue);
      doc.isLinearized();
      doc.getPDFVersion();

      GString *metadata;
      if ((metadata = doc.readMetadata())) {
        (void)metadata->getCString();
      }
      delete metadata;

      Object info;
      doc.getDocInfo(&info);
      if (info.isDict()) {
        info.getDict();
      }
      info.free();

      if ((acroForm = doc.getCatalog()->getAcroForm())->isDict()) {
        acroForm->dictLookup("XFA", &xfa);
        xfa.free();
      }

      SplashColor paperColor = {0xff, 0xff, 0xff};
      SplashOutputDev *splashOut = new SplashOutputDev(splashModeRGB8, 1, gFalse, paperColor);
      splashOut->setNoComposite(gTrue);
      splashOut->startDoc(doc.getXRef());

      doc.displayPages(splashOut, firstPage, lastPage, hdpi, vdpi, rotate, useMediaBox, crop, printing, nullptr, nullptr);
      (void)splashOut->getBitmap();

      delete splashOut;
    }
  } catch (...) {
  }

  delete globalParams;

  return 0;
}

